import React, { Component } from 'react'
import { ToastContainer, toast } from 'react-toastify';
import { get, post } from 'axios'
import { trackPromise, usePromiseTracker } from 'react-promise-tracker';
import { CONSTANTS } from '../../../util/Constants'
const url_syllabus = CONSTANTS.SYLLABUS
export default class Add extends Component {
  constructor(props) {
    super(props)
    this.state = {
      displayErrors: false
    }
    this.submit = this.submit.bind(this)
  }

  async submit(e) {
    e.preventDefault()
    if (this.formValidate()) {
      this.setState({ displayErrors: false });
      try {
        const syllabusCreateUrl = url_syllabus.CREATE_URL;
        const data = {
          subject_name: e.target.name.value,
          subject_type_id: "Subject",
          parent_subject: "",
          subject_id: "",
          parent_subject_id: "",
          description: e.target.description.value,
          type: 1  //e.target.syllabusType.value
        }
        const syllabus = (await (trackPromise(post(syllabusCreateUrl, data)))).data;
        const syllabusSuccessMsg = syllabus.message
        if (syllabus.statusCode == '200') {
          toast.success("Success: " + syllabusSuccessMsg);
          this.cancel()
          this.cancelButton.click()
        } else {
          toast.error("Error: " + syllabusSuccessMsg);
        }
      } catch (e) {
        toast.error(e.message);
      }
    }
  }

  formValidate() {
    if (!this.state.name) {
      toast.error("Please enter syllabus name");
      return false;
    }
    // else if(!this.state.syllabusType){
    //   toast.error("Please select syllabusType");
    //   return false;        
    // }
    else {
      return true;
    }

  }

  inputValidity(e) {
    if (e.target.checkValidity()) {
      this.setState({ [e.target.name]: true })
      return false;
    } else {
      return true;
    }
  }

  async cancel() {
    document.getElementById("my-form").reset();
  }

  render() {
    const { displayErrors } = this.state
    return (
      <div className="modal cus-Syllabus-modal fade" data-keyboard="false" data-backdrop="static" id="Initial_State">
        <div className="modal-dialog row">
          <div className="col-md-8 cusoverlay" />
          <div className="modal-content col-md-4 pzero">
            {/* Modal Header */}
            <div className="modal-header">
              <h4 className="modal-title">Add Syllabus</h4>
              <button type="button" className="close" data-dismiss="modal"><img src={process.env.PUBLIC_URL + "/images/close.svg"} alt="close" /></button>
            </div>
            {/* Modal body */}
            <div className="modal-body">
              <form id='my-form' onSubmit={this.submit} className={displayErrors ? 'displayErrors' : ''}>
                <div className="form-group">
                  <label htmlFor="formGroupExampleInput">Syllabus Name</label>
                  <input type="text" className="form-control required"
                    name="name" onChange={(e) => this.inputValidity(e)} placeholder="Introduction" />
                </div>
                <div className="form-group">
                  <label htmlFor="syllabusType">Type</label>
                  <select className="form-control required" id='syllabusType' name="syllabusType"
                  //  onChange={(e) => this.inputValidity(e)}
                  >
                    <option key="1" value="1">Salesforce Training</option>
                  </select>
                </div>
                <div className="form-group">
                  <label htmlFor="exampleFormControlTextarea1">Description</label>
                  <textarea className="form-control" name="description" placeholder="Add Description" rows={3} ></textarea>
                </div>
              </form>
            </div>
            {/* Modal footer */}
            <div className="modal-footer">
              <button
                type="button" className="btn btn-danger cancel" data-dismiss="modal"
                ref={cancel => this.cancelButton = cancel}
                onClick={() => this.cancel()}
              >
                Cancel
                    </button>
              <button className="btn btn-danger reset" onClick={() => this.cancel()}>Reset</button>
              <button form='my-form' type="submit" className="btn btn-danger add">ADD</button>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
